import "./Navbar.css";

// Components
import { NavLink, Link } from "react-router-dom";
import {
	BsSearch,
	BsHouseDoorFill,
	BsFillPersonFill,
	BsFillCameraFill,
} from "react-icons/bs";

const Navbar = () => {
	return (
		<div>
			<nav id="nav">
        <Link to="/"></Link>
      </nav>
		</div>
	);
};

export default Navbar;
